	["gs_usp_voltage"] = { name = "Lead Conduit", desc = "Den er blevet givet en specialindgraveret lyddæmper og skinne.\n\nDu fik, hvad du ønskede, men ved du, hvad det betyder? – Booth, våbenhandler" },
