	["gs_cz75a_redastor"] = { name = "Red Astor", desc = "Den er blevet håndmalet med røde og hvide toner.\n\nBooth er blevet synonym med familiedrama; og hvem har tid til drama, når vi snakker forretning - Huxley, konkurrenten" },
