	["am_mp9_bioleak"] = { name = "Bioleak", desc = "Vekslende skygger af grøn skaber illusionen af et kemisk udslip.\n\nPAS PÅ DIREKTE BLOTLÆGGELSE" },
	["hy_p2000_oceani"] = { name = "Oceanic", desc = "Den er blevet givet en sort underlak og betonet med blåt design.\n\nHar nogen hørt fra Kotaro eller Carmen? - Felix Riley, kommanderende officer" },
	["cu_p250_asiimov"] = { name = "Asiimov", desc = "Den er blevet specialmalet med et sci-fi-design.\n\nHvis du tror, jeg skal bruge en riffel for at dræbe en mand, har du ingen ide om, hvem du snakker til... - Mikha Biton, Phoenix-snigskytte" },
	["gs_sawedoff_fubar"] = { name = "Fubar", desc = "Dette velberejste haglgevær har tællemærker skåret ind i løbet.\n\nDet starter med et brag... det slutter med stilhed" },
	["cu_sg553_atlas"] = { name = "Atlas", desc = "Den er blevet givet en moderne camouflage-hydrographic.\n\nDet var engang et design øremærket til koalition-specialstyrken, men Huxley gav sig i kast med industrispionage for at gøre det eksklusivt til Phoenix" },
	["gs_ssg08_armacore"] = { name = "Ghost Crusader", desc = "Den er blevet malet hvid og givet nordpolsblå toner.\n\nJeg kan aldrig erstatte det, der blev taget fra os... men jeg kan tage endnu mere fra dem - The Phoenix and The Initiate, del 2" },
	["am_tec9_redblast"] = { name = "Re-Entry", desc = "Løbet er blevet givet et flammende klistermærkat.\n\nJeg hader altid at have ret - Carmen Cocinero, ekstraktionsekspert" },
