	["cu_xm1014_spectrum"] = { name = "Black Tie", desc = "Dette haglgevær, der er et syn i sort og hvidt krom, bruges bedst ved formelle lejligheder.\n\nVi har Izaki og Cocinero. Skal du bruge dem til noget, eller kan jeg bare dræbe dem nu? - The Mercenary and The Serpent, del 1" },
