	["gs_p90_tangled"] = { name = "Vent Rush", desc = "It has been custom painted to resemble a P90 intersecting with gaffer tape, tubes, and fire.\n\n\"Do you know how fast you were going?\"" },
	["cu_sawedoff_kisslove"] = { name = "Kiss♥Love", desc = "It has been custom painted with a starry-eyed woman in pink and purple.\n\n\"I won't take no for an answer; I have to have it!\"" },
	["cu_dual_elites_evil_flora"] = { name = "Flora Carnivora", desc = "Three brightly colored, hungry carnivorous plants have been custom painted on each Dual Beretta.\n\nHelp them grow up big and strong" },
	["gs_ump_roadblock"] = { name = "Roadblock", desc = "It has been custom painted with horizontal orange lines and forward facing arrows.\n\nSeek alternate routes" },
	["gs_glock_elite_camo"] = { name = "Winterized", desc = "It has been custom painted with a military camouflage in a winter colorway.\n\nFreeze!" },
	["cu_mag7_insomnia"] = { name = "Insomnia", desc = "Den er blevet specialmalet i orange og sorte toner med et design, der viser en fisk, som svømmer ind i en persons mund.\n\nBlop, blop, blop" },
	["cu_ak_head_shot_holo"] = { name = "Head Shot", desc = "Den er blevet specialmalet med graffiti af ordene \"HEAD SHOT GUN\" og har en skinnende lakering.\n\nAlle har mål, men er du villig til at gøre en indsats for at nå dem? – Booth, våbenhandler" },
	["gs_awp_limbo_snake"] = { name = "Duality", desc = "Den er blevet specialmalet med en slange på hver side. Den ene slange er rød, og den anden er guldfarvet.\n\nAlle historier har to sider" },
	["cu_m4a1s_feeding_frenzy"] = { name = "Emphorosaur-S", desc = "Den er blevet specialmalet, så det ser ud, som om en dinosaur river sin klo igennem siden af våbenet.\n\nFodringsvanvid" },
	["cu_p2000_decline"] = { name = "Wicked Sick", desc = "Specialmalet med neonfarvede designs, som skal fange (og fastholde) din opmærksomhed.\n\nMå jeg bede om din opmærksomhed?" },
	["cu_ump_clutch_kick"] = { name = "Wild Child", desc = "Under skitser af kugler, en krone og andre designs udgøres basen af neonfarvede striber på denne specialmalede UMP-45.\n\nKonceptet er enkelt – det er udførelsen, der er svær" },
	["cu_mp9_superlight"] = { name = "Featherweight", desc = "Den er blevet specialmalet i sort og hvid for at fremstå porøs, hvilket gør våbenet lettere at bære.\n\nEn god skarpskytte bebrejder ikke sine værktøjer" },
	["gs_scar_fragments_black"] = { name = "Fragments", desc = "Specialmalet i mørkegrå for at skabe en illusion om, at våbnets geometri har ændret sig.\n\nEt brudstykke af din fantasi" },
	["cu_glock_moon_rabbit"] = { name = "Umbral Rabbit", desc = "Den er blevet specialmalet med et drømmeagtigt motiv af en mystisk hoppende kanin foran en fuldmåne.\n\nTag springet" },
	["cu_m4a4_temukau"] = { name = "Temukau", desc = "Specialmalet i japansk animationsstil med et motiv af en kvindelig CT-agent, som bekæmper et stormangreb fra T-siden.\n\n\"Hold stillingen!\"" },
	["cu_mac10_sakkaku"] = { name = "Sakkaku", desc = "Under visse lysforhold lyser øjnene på denne specialmalede MAC-10 rødt.\n\nGør din opfattelse til deres virkelighed" },
	["cu_p250_rebuilt"] = { name = "Re.built", desc = "Denne P250 er blevet specialmalet med sammenflettede trekanter og andre rene, minimale design.\n\n9. gang er lykken" },
	["cu_mp5sd_quick_liquidation"] = { name = "Liquidation", desc = "Den mørke base og de nøje udvalgte røde og blå detaljer får denne specialmalede MP5-SD til at se ud, som om den skinner i det omgivende lys.\n\nStille refleksion" },
	["gs_r8_banana"] = { name = "Banana Cannon", desc = "Den er blevet specialmalet, så den ligner en meget moden banan.\n\nIngen sløve bananer her" },
	["gs_p90_neoqueen"] = { name = "Neoqueen", desc = "Den er blevet specialmalet med en blanding af militær- og sci-fi-motiver.\n\nLavet specielt til fart og ballade" },
	["cu_sg553_cyberforce"] = { name = "Cyberforce", desc = "CYBERFORCE INC-logoet er blevet specialmalet på en rød og sort base.\n\n\"CYBERFORCE INC: Vi sikrer din fremtid, så du ikke behøver at gøre det!\"" },
	["cu_tec9_freedom"] = { name = "Rebel", desc = "Denne specialmalede TEC-9 er dækket med løst tiknyttede design med en dæmpet farvepalet.\n\nÉt skud, ét drab, én runde ad gangen" },
	["gs_revolver_acanthus_bronze"] = { name = "Inlay", desc = "It has been custom painted to resemble acanthus engravings and a marble grip.\n\nOpulence in the palm of your hand" },
	["gs_ak47_strone"] = { name = "Steel Delta", desc = "The lines of this custom paint job resemble grooves on a topographical map.\n\nBleed between the lines" },
