	["gs_nova_sobek"] = { name = "Sobek's Bite", desc = "This custom paint job features gold and black Egyptian inspired designs.\n\nFrom the water comes chaos" },
	["gs_p250_apep"] = { name = "Apep's Curse", desc = "It has been custom painted using Egyptian patterns and materials as inspiration.\n\nIn opposition of Ra" },
	["hy_dune_trap"] = { name = "Snake Pit", desc = "A custom pattern of snakes and amphibians has been applied.\n\nActing on ill intentions" },
	["cu_p90_scarab_of_wisdom"] = { name = "ScaraB Rush", desc = "It has been custom painted with scarabs and Egyptian inspired designs.\n\nResurrection requires death, and death requires rushing" },
	["gs_ssg08_anubis"] = { name = "Azure Glyph", desc = "It has been custom painted with blue water, Egyptian hieroglyphs, and finished with wood running the length of the weapon.\n\nFlood warning" },
	["cu_tec9_mummy"] = { name = "Mummy's Rot", desc = "It has been custom painted to resemble a mummy. A cobra with green eyes has been painted beneath the rear sight.\n\nKeep this under wraps" },
	["gs_usps_tactical_camo"] = { name = "Desert Tactical", desc = "It has been custom painted with an olive-colored tactical camouflage.\n\nBase models don't have to be boring" },
	["cu_xm1014_pharaoh"] = { name = "Hieroglyph", desc = "It has been custom painted with Egyptian hieroglyphs and ornaments.\n\nThe moral of the story" },
	["sp_nukestripe"] = { name = "sp_nukestripe", desc = "Den er blevet spraymalet med strålingsfare-advarselsmønstre." },
	["sp_spray_waves_bravo"] = { name = "sp_spray_waves_bravo", desc = "Dette minde fra Seaside er blevet frihåndsspraymalet med korte, tykke linjer i kontrastfarver.\n\nPerfekt til oprøreren på farten" },
	["hy_ocean_bravo"] = { name = "hy_ocean_bravo", desc = "Dette minde fra Seaside er blevet malet med en blå camo-hydrographic.\n\nVores verden af en af intriger... men nogle gange skal camouflage blive set - Booth, våbenhandler" },
	["sp_spitfire_famas_bravo"] = { name = "sp_spitfire_famas_bravo", desc = "Dette minde fra Cache er blevet malet med en hajs mund i stil med flynæse-kunst.\n\nJester er død" },
	["hy_tile_bravo"] = { name = "hy_tile_bravo", desc = "Dette minde fra Ali er blevet malet med en mosaik-hydrographic.\n\nTålmodighed er en dyd" },
	["an_navy_bravo"] = { name = "an_navy_bravo", desc = "Dette minde fra Ali er blevet malet med en krom underlak og kandiseret i gennemsigtig marineblå-eloxeret effektmaling.\n\nJeg har allerede mistet én mand til Valerias løgne... Jeg har ikke i sinde at miste flere - Felix Riley, kommanderende officer" },
	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "Dette minde fra Siege er blevet spraymalet med et farestribemønster.\n\nAL OVERGANG FORBUDT" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "Dette minde fra Gwalior er blevet spraymalet med afrevne tapestrimler og gennemhullet metal som skabelon.\n\nVær ikke bekymret.... Der kommer snart gang i forretningen - Booth, våbenhandler" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "Dette minde fra Ruins er blevet malet med et Digital Disruptive Pattern (DDPAT)-hydrographic.\n\nSelv hvis du ikke kan se det, vil du helt sikkert høre det" },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "Dette minde fra Ruins har individuelle dele spraymalet med solide farver i en jungle-farvesammensætning.\n\nFor dem med en appetit for ødelæggelse" },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "Dette minde fra Ali har individuelle dele spraymalet med solide farver i en tornado-farvesammensætning.\n\nOrd er vind, men vind kan dræbe" },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "Dette minde fra Gwalior har individuelle dele spraymalet med solide farver i en sanddynge-farvesammensætning.\n\nGonzo-journalisten Alex Kincaide forsvandt efter han tog til Maghreb for at dække Operation Vanguard" },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "Dette minde fra Cache har individuelle dele spraymalet med solide farver i en ensformig oliven-farvesammensætning.\n\nTag aldrig sejr for givet" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Dette minde fra Siege er blevet malet med en våbenmetal-eloxeret effektmaling over en krom underlak.\n\nDu kender ikke Felix Riley som jeg... Manden er umulig at knække - The Traitor and The Truthseeker, del 1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "Dette minde fra Seaside er blevet malet med en gennemsigtig, blå abstrakt hydrographic over en metallisk underlak.\n\nBølger bryder, vores løsninger gør ikke - Kotaro Izaki, indtrængningsekspert" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "Dette minde fra Agency er blevet malet i et polygon-mønster med metalliske malinger med forskellige refleksionsevner over en krom underlak.\n\nBlyanter ned, hænderne op" },
	["aq_steel"] = { name = "aq_steel", desc = "Den er stadig perfekt funktionsdygtig selvom de ydre overflader er rustet.\n\nNogle folk behøver ikke skjule, hvor beskidte deres gerninger er" },
	["hy_hex"] = { name = "hy_hex", desc = "Den er blevet malet med en sekskant-mønsteret hydrographic." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "Den er blevet malet med en hydrographic med et overdimensioneret camouflagemønster." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Den er blevet dækket i metalfolie stemplet med et Digital Disruptive Pattern (DDPAT)-mønster." },
	["twigs"] = { name = "twigs", desc = "Den er blevet frihåndsspraymalet med kviste som skabelon." },
	["varicamo"] = { name = "varicamo", desc = "Den er blevet malet med en VariCamo-mønstret hydrographic.\n\nGenopbygning kommer kun efter ødelæggelse" },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "Den er blevet smedet af en barre bestående af to forskellige slags kulstofstål.\n\nEndelig, et våben stærkt nok til at passe til din beslutsomhed" },
	["am_crystallized"] = { name = "am_crystallized", desc = "Den er blevet malet med metallisk maling og bruger en krystalliserende maske for at lave et mønster.\n\nAlle vil gøre en forskel" },
	["snakeskin"] = { name = "snakeskin", desc = "Den er blevet malet med en slangeskindsmønstret hydrographic.\n\nJeg ved, at du ikke tror på sagen... og når jeg afslører dig, vil Valeria have dit hoved - The Shield and The Serpent, del 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Den er blevet malet kobaltblå og fået påført CT-logoet på skinnen.\n\nJeg kan følge proceduren og få 7 ud, eller jeg kan gøre det på min måde og redde alle 10... Dit valg - Carmen Cocinero, ekstraktionsekspert" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Den er blevet malet med en hydrographic i et muldvarpegråt og blågrønt tern-mønster.\n\nDet er ikke en sækkepibe, men den spiller en sang før hver begravelse" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Den er blevet specialmalet med urban camo og røde toner.\n\nHvert år samler Booth verdens mest fremtrædende våbendesignere for at vise deres seneste designs frem" },
	["an_emerald"] = { name = "an_emerald", desc = "Den er blevet malet med en krom underlak og kandiseret i gennemsigtig smaragd-eloxeret effektmaling.\n\nDette er hvad den store Sebastien Hennequet er blevet reduceret til? En nagende skolekvinde? Hvad er der sket med dig... - The Teacher and The Iconoclast, del 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Den har individuelle dele spraymalet solide farver i et blåt og orange farveskema.\n\nDen store udligner" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Den er blevet specialmalet med en kombination af hydrographics og forsigtig skabelonbrug og detaljeret med varmeoverførte mærkater.\n\nChase Turner var en stor mand... du har meget at skulle indhente - The Phoenix and The Initiate, del 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Den er blevet indgraveret med skeletter, blomster og slanger.\n\nDet er derfor, Huxley gør al det hårde arbejde, vi skal bare puffe hende fremad... - The Serpent and The Truth Seeker, del 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Den er blevet specialmalet i et moderne rødt og gråt design, der komplimenterer våbnets form.\n\nVi er altid stærkere sammen" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Den er blevet specialmalet med et væmmeligt uhyre i psykedeliske farver.\n\nDe kalder dig Oni, ikke? Hvilket uhyggeligt navn til så trist en mand... – Elliot Kingsman, lejesoldat" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "Den er blevet malet med en blå camo-hydrographic." },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "It has been custom painted with a stark black and white design and finished with pearlescent highlights.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "It has been custom painted with a stark black and white design and finished with pearlescent highlights.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1; PISTOL_1;" },
